<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Contact</title>
    <link rel="stylesheet" href="/app.ca21ace1.css">
</head>
<body>
   <!-- We could take out the nav because it is not changing since it's not in the router-wrapper -->

    <!-- Anything inside data-router-wrapper will be transformed -->
    <!-- You can only have one child inside of data-router-wrapper -->
    <!-- If more sections are needed add it into the router-view -->
    <main data-router-wrapper="">
        <!-- data-router-view is what you will be transforming -->
        <section data-router-view="contact" class="contact">
            <div class="contact-content">
                <div class="contact-presentation">
                    <h1>Get in touch with me</h1>
                    <h3>This my jam yo</h3>
                </div>
            </div>
        </section>
    </main>

    <script src="/js.00a46daa.js"></script>
</body>
</html>
